import React, { useState } from "react";
import {
    Paper,
    Table,
    TableBody,
    TableCell,
    TableContainer,
    TableHead,
    TableRow,
    TextField,
    Chip,
    IconButton,
    TablePagination,
    Toolbar,
    Typography,
} from "@mui/material";
import FilterListIcon from "@mui/icons-material/FilterList";
import SearchIcon from "@mui/icons-material/Search";

const data = [
    { name: "Frozen yoghurt", calories: 159, date: "4/5/2021", time: "3:15:05 PM", recommended: "Yes", price: "$2.99" },
    { name: "Ice cream sandwich", calories: 237, date: "4/1/2021", time: "12:15:15 AM", recommended: "Yes", price: "$5.99" },
    { name: "Eclair", calories: 262, date: "2/15/2021", time: "12:45:25 PM", recommended: "No", price: "$0.99" },
    { name: "Cupcake", calories: 305, date: "7/5/2021", time: "8:30:35 AM", recommended: "No", price: "$1.50" },
    { name: "Gingerbread", calories: 356, date: "12/23/2020", time: "9:58:45 AM", recommended: "Yes", price: "$7.00" },
];

const filters = [
    "Calories ≥ \"150\"",
    "11/1/2020 ≤ Date ≤ 8/31/2021",
    "Price ≤ \"$10.00\"",
];

const FilterableTable = () => {
    const [search, setSearch] = useState("");
    const [page, setPage] = useState(0);
    const [rowsPerPage, setRowsPerPage] = useState(5);

    const handleSearchChange = (event) => {
        setSearch(event.target.value);
    };

    const handlePageChange = (event, newPage) => {
        setPage(newPage);
    };

    const handleRowsPerPageChange = (event) => {
        setRowsPerPage(parseInt(event.target.value, 10));
        setPage(0);
    };

    const filteredData = data.filter((row) => row.name.toLowerCase().includes(search.toLowerCase()));

    return (
        <Paper sx={{ width: "100%", overflow: "hidden", padding: 2 }}>
            <Typography variant="h6" gutterBottom>
                Basic Filtering Preview
            </Typography>
            <Toolbar>
                <FilterListIcon sx={{ marginRight: 1 }} />
                {filters.map((filter, index) => (
                    <Chip key={index} label={filter} onDelete={() => { }} sx={{ marginRight: 1 }} />
                ))}
                <TextField
                    variant="outlined"
                    size="small"
                    placeholder="Search"
                    value={search}
                    onChange={handleSearchChange}
                    sx={{ marginLeft: "auto" }}
                    InputProps={{
                        startAdornment: <SearchIcon />,
                    }}
                />
            </Toolbar>
            <TableContainer>
                <Table>
                    <TableHead>
                        <TableRow>
                            <TableCell>Dessert (100g serving)</TableCell>
                            <TableCell>Calories</TableCell>
                            <TableCell>Date</TableCell>
                            <TableCell>Time</TableCell>
                            <TableCell>Recommended</TableCell>
                            <TableCell>Price</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {filteredData.slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage).map((row, index) => (
                            <TableRow key={index}>
                                <TableCell>{row.name}</TableCell>
                                <TableCell>{row.calories}</TableCell>
                                <TableCell>{row.date}</TableCell>
                                <TableCell>{row.time}</TableCell>
                                <TableCell>{row.recommended}</TableCell>
                                <TableCell>{row.price}</TableCell>
                            </TableRow>
                        ))}
                    </TableBody>
                </Table>
            </TableContainer>
            <TablePagination
                rowsPerPageOptions={[5, 10, 25]}
                component="div"
                count={filteredData.length}
                rowsPerPage={rowsPerPage}
                page={page}
                onPageChange={handlePageChange}
                onRowsPerPageChange={handleRowsPerPageChange}
            />
        </Paper>
    );
};

export default FilterableTable;
